import React from 'react'
import {
    View,
    Text,
    StyleSheet,
    Image,
    TouchableOpacity
} from 'react-native'

const ProductItem = () => {
    return (
        <TouchableOpacity style={styles.containe} activeOpacity={0.5}>
            <Image
                resizeMode="cover"
                style={{
                    position : "absolute",
                    paddingTop: 5,
                    right: 0,
                    height : 200,
                    width: "98%"
                }}
                source={{
                    uri: 'https://res.cloudinary.com/http-codingcampus-pythonanywhere-com/image/upload/v1615399961/test/lwmgl7wiob0ptb8wrfq5.png'
                }}
            />
            <View style={styles.Image_pro}>
                <Text>Ashutosh</Text>

                <View style={{ justifyContent: "flex-end", marginLeft: 1 }}>
                    <Text>$234</Text>
                </View>
            </View>
        </TouchableOpacity>
    )
}

export default ProductItem

const styles = StyleSheet.create({
    containe: {
        height: 250,
        width: 150,
        marginHorizontal: 4,
        marginTop: 5,
        backfaceVisibility : "lightblue"
    },

    Image_pro: {
        
    }
})
